import styled from 'styled-components';
import React from "react"; 
const HeaderWrapper = styled.header`
  background-color: #333;
  color: white;
  padding: 1em;
`;

const Nav = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;
function ContactsHeader()
{ return ( <HeaderWrapper>
 <Nav>
 <div>
  <h1>Lista kontakt√≥w</h1>
  </div>
 <div>
 <button>Dodaj</button>
 </div>
 </Nav>
 </HeaderWrapper>
 );
} 

class ContactItem extends React.Component { render() { const {
  login, name, department } = this.props; return ( <li>
   <div>
   <h2>{login}</h2>
   <h4>{name}</h4>
   <div>{department}</div>
   </div>
   </li>
   );
   }
  } 

 function ContactsList() {
  return (
   <ul>
   <ContactItem login="Kontakt1" name="Jarek" department="JavaScript Developer" />
   <ContactItem login="Kontak2" name="Marek" department="Human Resources" />
   <ContactItem login="Kontakt3" name="Czarek" department="QA" />
   </ul>
   );
  } 


  const Contacts = () => {
    return (
      <div>
        <ContactsHeader />
        <ContactsList />
      </div>
    );
  };

  export default Contacts;
